  \"Tunable Interior Rotorcraft Noise Control Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T03:47:07.562079\",\n\t\"name\": \"tunable-interior-rotorcraft-noise-control-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"CRG has recently developed a new class of
  shape memory polymers (SMP) that are electrically activated, as opposed to the more
  mature thermally activated SMPs. Electrically activated shape memory polymers (EASMP)
  open a new design space of unexplored functionality beyond what has been considered
  for thermally activated materials. This project will combine the advantages of EASMP
  with the design of state-of-the-art gearbox isolators and interior panels to provide
  the ability to tune these components for specific operational frequencies. With
  the use of EASMP integrated components, by semi-actively altering the interior panels
  or gearbox isolators' frequency response, it will be possible to better target and
  control particularly irritating tones related to the aircraft's flight mode. CRG
  proposes to advance EASMP maturity which is applicable across many other application
  areas and has the benefit of alternative stimuli boasting ultra-low power requirements
  and more potential for faster switching times. This material will be refined and
  further developed to meet the operational performance requirements for the rotorcraft
  isolator application.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
